import React from 'react';
import Header from './Header/Header'
import './App.css';

function App() {

  return (
    <div className="App">
      <div className="App-header">
      <div>
        <h1>Bonjour, monde !</h1>
        <h2>Il est {new Date().toLocaleTimeString()}.</h2>
      </div>
      </div>
    </div>
  );
}

export default App;
